import axios from "axios";
const BASE_URL = process.env.REACT_APP_BASE_URL;

class ApiService {
  createNewAccount() {
    return axios.post(`${BASE_URL}/public/addNew/parent`);
  }
  getApiBaseUrl() {
    return BASE_URL;
  }
}

export default new ApiService();
